import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { Header } from './components/Header';
import { Calendar } from './components/Calendar';
import { AuthPage } from './components/auth/AuthPage';
import { FinancialEntryForm } from './components/FinancialEntryForm';
import { useFinancialData } from './hooks/useFinancialData';
import { AuthProvider, useAuth } from './context/AuthContext';
import { FinancialEntry, CalendarViewType, RecurringPayment } from './types';
import { RecurringPayments } from './components/RecurringPayments';
import './App.css';

// Protected route component
const ProtectedRoute: React.FC<{ children: React.ReactNode }> = ({ children }) => {
  const { isAuthenticated } = useAuth();
  return isAuthenticated ? <>{children}</> : <Navigate to="/login" />;
};

// Main app component (without auth context)
const AppContent: React.FC = () => {
  const [view, setView] = useState<CalendarViewType>('month');
  const [currentDate, setCurrentDate] = useState<Date>(new Date());
  const [showEntryForm, setShowEntryForm] = useState(false);
  const [editingEntry, setEditingEntry] = useState<FinancialEntry | null>(null);
  const [error, setError] = useState<string | null>(null);

  const {
    entries,
    addEntry,
    updateEntry,
    deleteEntry,
    recurringPayments,
    addRecurringPayment,
    updateRecurringPayment,
    deleteRecurringPayment,
    monthData,
    yearData,
  } = useFinancialData(currentDate);

  const handleAddEntry = (entry: Omit<FinancialEntry, 'id'>) => {
    try {
      addEntry(entry);
      setShowEntryForm(false);
      setEditingEntry(null);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to add entry');
    }
  };

  const handleUpdateEntry = (entry: FinancialEntry) => {
    try {
      updateEntry(entry);
      setEditingEntry(null);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to update entry');
    }
  };

  const handleDeleteEntry = (id: string) => {
    try {
      deleteEntry(id);
    } catch (err) {
      setError(err instanceof Error ? err.message : 'Failed to delete entry');
    }
  };

  const handleUpdateRecurringPayment = (id: string, payment: Partial<RecurringPayment>) => {
    const existingPayment = recurringPayments.find(p => p.id === id);
    if (existingPayment) {
      updateRecurringPayment({ ...existingPayment, ...payment });
    }
  };

  return (
    <div className="app">
      <Header title="Personal Budget Tracker" />
      
      <main className="app-main">
        <Routes>
          <Route 
            path="/" 
            element={
              <ProtectedRoute>
                {entries && recurringPayments ? (
                  <>
                    <div className="view-controls">
                      <button onClick={() => setView('day')}>Day</button>
                      <button onClick={() => setView('week')}>Week</button>
                      <button onClick={() => setView('month')}>Month</button>
                      <button onClick={() => setView('year')}>Year</button>
                    </div>
                    <button onClick={() => setShowEntryForm(true)}>Add New Entry</button>
                  </>
                ) : (
                  <div className="loading">Loading calendar data...</div>
                )}
                <Calendar
                  view={view}
                  currentDate={currentDate}
                  onDateChange={setCurrentDate}
                  monthData={monthData}
                  yearData={yearData}
                  onAddEntry={handleAddEntry}
                  onUpdateEntry={handleUpdateEntry}
                  onDeleteEntry={handleDeleteEntry}
                  onViewChange={setView}
                />

                {showEntryForm && (
                  <FinancialEntryForm
                    entry={editingEntry}
                    onSave={handleAddEntry}
                    onCancel={() => {
                      setShowEntryForm(false);
                      setEditingEntry(null);
                    }}
                  />
                )}

                <RecurringPayments
                  recurringPayments={recurringPayments}
                  onAddRecurringPayment={addRecurringPayment}
                  onUpdateRecurringPayment={handleUpdateRecurringPayment}
                  onDeleteRecurringPayment={deleteRecurringPayment}
                />
              </ProtectedRoute>
            } 
          />
          <Route path="/auth" element={<AuthPage />} />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </main>
      
      <footer className="app-footer">
        <p>Â© {new Date().getFullYear()} Personal Budget Tracker</p>
      </footer>
    </div>
  );
};

// Root component with providers
const App: React.FC = () => {
  return (
    <AuthProvider>
      <Router>
        <Routes>
          <Route path="/" element={<AppContent />} />
          <Route path="/auth" element={<AuthPage />} />
        </Routes>
      </Router>
    </AuthProvider>
  );
};

export default App;
